column8:
陶器のトレイと、爽やかなグリーンのパイプでできたキュートな傘立て。<br>
異素材の組み合わせが新鮮で、長い傘は輪の中へ、折りたたみは外の突起へ引っ掛けられます。<br>
しっかりした重みがあるので、転倒する心配もありません。<br><br>
SPEC<br>
サイズ：直径250mm、高さ650mm<br>
素材：スチール、粉体塗装　陶器<br>
生産国：台湾<br>
