新発想の鳥かごみたいな形状がカワイイ傘立て。<br>
通常の長傘はもちろん、ミニフックが付いているので、折り畳み傘も引っ掛けらます。<br>
こんな傘立てなら、子供たちも雨の日が楽しくなるかも？<br>
傘立て以外にも、植物を入れて飾ればキュートなデコレーションとしても使えそう。<br>
水受けトレーが取り外せて、機能面にもぬかりはありません。<br><br>
SPEC<br>
サイズ：直径235mm、高さ570mm<br>
素材：スチール、粉体塗装<br>
